import { useEffect, useState } from 'react';
import { returnNumber } from './utils/globals';
import './App.css';

const App = () => {
  let [number, setNumber] = useState(0);

  useEffect(() => {
    setNumber(returnNumber());
  }, []);

  return (
    <div className="container">
      <p>Heres a number: {number}</p>
    </div>
  );
};

export default App;
